apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  annotations: &a1
    sealedsecrets.bitnami.com/cluster-wide: "true"
  name: n8n-env
spec:
  encryptedData:
    # N8N Auth
    N8N_BASIC_AUTH_USER: 
    N8N_BASIC_AUTH_PASSWORD: 
    N8N_ENCRYPTION_KEY: 

    # MINIO
    MINIO_ENDPOINT: 
    MINIO_USERNAME: 
    MINIO_PASSWORD: 

    # BCE
    MINIO_BCE_USERNAME: 
    MINIO_BCE_PASSWORD: 

    # Azure file share
    AZURE_CONNECTION_STRING: 

    # Elastic search API Key
    ELASTIC_SEARCH_API_KEY: 

    SMTP_USERNAME: 
    SMTP_PASSWORD: 

    # Email notifications
    NOTIFICATION_MAIL_FROM: 
    NOTIFICATION_MAIL_TO: 
  template:
    metadata:
      annotations: *a1
      name: n8n-env
    type: Opaque
